        internal void ClumpFindingTest()
        {
            ClumpFindingTest("AAAACGTCGAAAAA", 2, 4, 2, "AA");
            ClumpFindingTest("ACGTACGT", 1, 5, 2, new[] { "A", "C", "G", "T" });
            ClumpFindingTest("CGGACTCGACAGATGTGAAGAACGACAATGTGAAGACTCGACACGACAGAGTGAAGAGAAGAGGAAACATTGTAA",
                             5, 50, 4, new[] { "CGACA", "GAAGA" });
            ClumpFindingTest("CCACGCGGTGTACGCTGCAAAAAGCCTTGCTGAATCAAATAAGGTTCCAGCACATCCTCAATGGTTTCACGTTCTTCGCCAATGGCTGCCGCCAGGTTATCCAGACCTACAGGTCCACCAAAGAACTTATCGATTACCGCCAGCAACAATTTGCGGTCCATATAATCGAAACCTTCAGCATCGACATTCAACATATCCAGCG",
                             3, 25, 3, new[] { "AAA", "CAG", "CAT", "CCA", "GCC", "TTC" });
            ClumpFindingTest("",
                             11, 566, 18, "AAACCAGGTGG");
        }

        private void PatternCountTest(string text, string pattern, int expected)
        {
            int count = _solver.PatternCount(text, pattern);
            Assert.AreEqual(expected, count);
        }

        private void FrequentWordsTest(string text, int k, string expected)
        {
            FrequentWordsTest(text, k, new[] { expected });
        }
        private void FrequentWordsTest(string text, int k, ICollection expected)
        {
            IEnumerable<string> words = _solver.FrequentWords(text, k);
            CollectionAssert.AreEquivalent(expected, words.ToList());
        }

        private void ReverseComplementTest(string pattern, string expected)
        {
            string reverseComplement = _solver.ReverseComplement(pattern);
            Assert.AreEqual(expected, reverseComplement);
        }

        private void PatternMatchingTest(string pattern, string genome, int expected)
        {
            PatternMatchingTest(pattern, genome, new [] { expected });
        }
        private void PatternMatchingTest(string pattern, string genome, int[] expected)
        {
            List<int> positions = _solver.PatternMatching(pattern, genome).ToList();
            CollectionAssert.AreEqual(expected, positions);
        }

        private void ClumpFindingTest(string genome, int k, int windowLength, int times, string expected)
        {
            ClumpFindingTest(genome, k, windowLength, times, new[] { expected });
        }
        private void ClumpFindingTest(string genome, int k, int windowLength, int times, string[] expected)
        {
            List<string> kmers = _solver.ClumpFinding(genome, k, windowLength, times).ToList();
            CollectionAssert.AreEquivalent(expected, kmers);
        }

        private readonly ITasksSolver _solver;
    }
}